import React, { Component } from 'react';
// Icons
import { FaBell } from 'react-icons/fa';
import { FaUser } from 'react-icons/fa';
import { FaBookmark } from 'react-icons/fa';
import { FaSearch } from 'react-icons/fa';

export default class Nav extends Component {
  state = {
  }

  render () {
      return (
        <nav>
          <ul>
           <li><a href="/">Logo</a></li>
           <li><a href="/jobs">Jobs</a></li>
           <li><a href="/bookmarks"><span style={{verticalAlign: 'middle'}}><FaBookmark /></span>&nbsp; Bookmarks</a></li>
           <li className="dropdown">
             <span id="nav-drop-link"><span style={{verticalAlign: 'middle'}}><FaUser /></span>&nbsp; Me <span className="dropdown-arr">&#x25BE;</span></span>
             <div className="dropdown-content">
               <a href="/user-profile">Profile</a>
               <a href="/user-settings">Settings</a>
             </div>
           </li>
           <li><span id="search-icon-wrapper"><FaSearch style={{verticalAlign: 'middle', color: '#eeeeee'}} /></span><input type="text" placeholder={"Search for a job..."} className="search"></input></li>
           <li><a href="/notfication"><span style={{verticalAlign: 'middle'}} id="noti-bell"><FaBell /><div id="alert"></div></span></a></li>
          </ul>
        </nav>
      )
   }
}
